// Function to read features from a file
float* read_features(const std::string &file_path, size_t &num_features) {
    std::ifstream file(file_path);

    //Check if filepath is correct and file is working correctly 
    //if not return error
    if (!file.is_open()) {
        std::cerr << "ERROR: Could not open file " << file_path << std::endl;
        return nullptr;
    }

    std::vector<float> features_vector;
    std::string value;

    

    //With 'getline', we assign the part up to ',' from the file to 'value' and make it a string to float using stof
    while (std::getline(file, value, ',')) {
        //after parsing string and convert it to float we push these floats to 'features_vector'
        features_vector.push_back(std::stof(value));
    }

    std::cout << "Features_vector size: " << features_vector.size() << std::endl;
    
    //assign 'features_vector.size()' to our 'num_features' because we want to check if our
    //input frame size is matching with required input frame size 
    num_features = features_vector.size();
    float* features = new float[num_features]; //we create  float feature array with given input size 
    //with memcpy we send the data of the 'features_vector' to 'features' and the required space is given by num_features * sizeof(float)
    std::memcpy(features, features_vector.data(), num_features * sizeof(float)); // num_features * sizeof(float) gives us total space needed for copying

    return features; // we return feature array
}


float* features = nullptr;  // Pointer to the features array

int main(int argc, char* argv[]) {

    std::cout <<"Count: "<<argc<<"\n";
    std::cout << "File Name:" << argv[1] << "\n";
    
    //Check if the number of command-line arguments is not equal to 2
    if (argc != 2) {
        std::cerr << "Usage: " << argv[0] << " <features_file>" << std::endl;
        return 1;
    }
    //We are getting our features_file path from command line arguments
    std::string features_file = argv[1];
    size_t num_features;
    features = read_features(features_file, num_features); //we are reading our features from file using read_feautres
    std::cout << "Size: " << sizeof(features) << std::endl;
    std::cout << "Size features[0]: " << sizeof(features[0]) << std::endl;

    if (!features) {
        return 1; // Error message already printed in read_features
    }


    /*
    // Ensure the size of the features matches the expected input frame size
    std::cout << "Size: " << features.size() << std::endl;
    std::cout << "Size of Features:" << sizeof(features)  << "size of first element: " << sizeof(features[0]) << std::endl;
    
    if (features.size() != EI_CLASSIFIER_DSP_INPUT_FRAME_SIZE) {
        std::cerr << "OOOOOOOOO ERROR: The size of the input buffer is not correct." << std::endl;
        std::cerr << "AAAAAAAAAAAAAA Expected " << EI_CLASSIFIER_DSP_INPUT_FRAME_SIZE << " items, but got " << features.size() << std::endl;
        return 1;
    }
    */


    

    signal_t signal;            // Wrapper for raw input buffer
    ei_impulse_result_t result; // Used to store inference output
    EI_IMPULSE_ERROR res;       // Return code from inference

    // Calculate the length of the buffer
    size_t buf_len = num_features;

    // Make sure that the length of the buffer matches expected input length
    if (buf_len != EI_CLASSIFIER_DSP_INPUT_FRAME_SIZE) {
        ei_printf("ERROR: The size of the input buffer is not correct.\r\n");
        ei_printf("Expected %d items, but got %d\r\n",
                EI_CLASSIFIER_DSP_INPUT_FRAME_SIZE,
                (int)buf_len);
        return 1;
    }

    // Assign callback function to fill buffer used for preprocessing/inference
    signal.total_length = EI_CLASSIFIER_DSP_INPUT_FRAME_SIZE;
    signal.get_data = &get_signal_data;

    // Perform DSP pre-processing and inference
    res = run_classifier(&signal, &result, false);

    // Print return code and how long it took to perform inference
    ei_printf("run_classifier returned: %d\r\n", res);
    ei_printf("Timing: DSP %d ms, inference %d ms, anomaly %d ms\r\n",
            result.timing.dsp,
            result.timing.classification,
            result.timing.anomaly);

    // Print the prediction results (object detection)
#if EI_CLASSIFIER_OBJECT_DETECTION == 1
    ei_printf("Object detection bounding boxes:\r\n");
    for (uint32_t i = 0; i < result.bounding_boxes_count; i++) {
        ei_impulse_result_bounding_box_t bb = result.bounding_boxes[i];
        if (bb.value == 0) {
            continue;
        }
        ei_printf("  %s (%f) [ x: %u, y: %u, width: %u, height: %u ]\r\n",
                bb.label,
                bb.value,
                bb.x,
                bb.y,
                bb.width,
                bb.height);
    }

    // Print the prediction results (classification)
#else
    ei_printf("Predictions:\r\n");
    for (uint16_t i = 0; i < EI_CLASSIFIER_LABEL_COUNT; i++) {
        ei_printf("  %s: ", ei_classifier_inferencing_categories[i]);
        ei_printf("%.5f\r\n", result.classification[i].value);
    }
#endif

    // Print anomaly result (if it exists)
#if EI_CLASSIFIER_HAS_ANOMALY
    ei_printf("Anomaly prediction: %.3f\r\n", result.anomaly);
#endif

#if EI_CLASSIFIER_HAS_VISUAL_ANOMALY
    ei_printf("Visual anomalies:\r\n");
    for (uint32_t i = 0; i < result.visual_ad_count; i++) {
        ei_impulse_result_bounding_box_t bb = result.visual_ad_grid_cells[i];
        if (bb.value == 0) {
            continue;
        }
        ei_printf("  %s (%f) [ x: %u, y: %u, width: %u, height: %u ]\r\n",
                bb.label,
                bb.value,
                bb.x,
                bb.y,
                bb.width,
                bb.height);
    }
    ei_printf("Visual anomaly values: Mean : %.3f Max : %.3f\r\n",
    result.visual_ad_result.mean_value, result.visual_ad_result.max_value);
#endif

delete[] features; // Don't forget to delete the dynamically allocated array


    return 0;
}

// Callback: fill a section of the out_ptr buffer when requested
static int get_signal_data(size_t offset, size_t length, float *out_ptr) {
    for (size_t i = 0; i < length; i++) {
        out_ptr[i] = (features + offset)[i];
    }

    return EIDSP_OK;
}
